var SongSearch=this.SongSearch||{};SongSearch.init=function(){$("#search-form input").keyup(function(){var n=$(this).val();n.length>2?(SongSearch.clearSuggestions(),SongSearch.getSongs(n)):0===n.length&&SongSearch.clearSuggestions()})},SongSearch.getSongs=function(n){$.ajax({url:"https://api.spotify.com/v1/search",data:{q:n,type:"track",limit:5},success:function(n){n.tracks.items.forEach(SongSearch.showSuggestions)},error:function(){$("body").append("<p>No songs found.</p>")}})},SongSearch.showSuggestions=function(n){$(".search-suggestions").append("<li>"+n.name+"</li>"),$(".search-suggestions li").unbind().click(function(){SongSearch.printSongData($(this).text()),SongSearch.clearSuggestions()})},SongSearch.clearSuggestions=function(){$(".search-suggestions").empty()},SongSearch.printSongData=function(n){var e=new Date;$(".search-results").append("<li>"+n+" "+e+"</li>")};
!function(){SongSearch.init()}();